webpackJsonp([0x60c79daab0c4],{769:function(e,n){e.exports={data:{markdownRemark:{html:'<p><a class=\'caption\' target="_blank" href=\'https://www.flickr.com/photos/96dpi/3227807209/in/photolist-5VemCr-4X6jfP-auJauT-9qTqa9-tvyxD-4M5kqA-3jP9wP-5x8zJN-asF7f6-5BHgWz-8Cv1jT-fGkfz-5hXacN-bPQdw-cDkyh-nVifwy-3u2HzY-nv6for-387PiC-2D33H-dSn57K-4LGiT-5EHVa3-4zbMat-dreM17-3s8BkN-kMPcaJ-dMXvfx-idewxJ-4qTcVz-JNV2j-c4nb9-5PzNJx-cAtxiU-dSVjVd-aQ8mca-i9XQU2-6un744-JNUgu-aKji-nMqa73-nKxwCG-g3dYR-k2DNo-efUZno-nq28vw-8eDSbB-8bWcLu-n95njT-4mu7fJ\'>Header Photo credit to Adreas Levers</a></p>\n<h1>Guess Who\'s Back?</h1>\n<p>It\'s been a few months since the last <a href="http://richsoni.com">richsoni.com</a> update.</p>\n<p>I poured my attention into a passion project: <a href="http://gifficult.com">gifficult.com</a>.\nThe site is a new way to visualize Reddit, <a href="http://gifficult.com"><em>Try It Out</em></a>.</p>\n<p><a href="http://gifficult.com">Gifficult</a> has stabalized as a project.\nAs such, I have energy to focus back on RichSoni.</p>\n<h2>RichSoni is now an LLC</h2>\n<p>I am now my own legal company!\nIn celebration of this exciting news, I am releasing a trove of things.</p>\n<h2>Mailing List</h2>\n<p>My mailing list is now up and running.\n<a href="http://richsoni.us8.list-manage.com/subscribe/post?u=bc85e50b336a97670d097c9d0&#x26;id=cd363f3412">I invite you to join</a>.</p>\n<p>As a member, you get all of my bleeding edge material.</p>\n<p>I also engage the thoughts and opinions on fresh ideas with the members.\nThis is exclusive content unavailable to the laymen viewership of my website.</p>\n<h2>A Post For Everyone</h2>\n<p>I am releasing 3 exciting new blog posts.</p>\n<ol>\n<li><a href="http://richsoni.com/lucid">Unravelling The Ancient Art Of Lucid Dreaming</a></li>\n<li><a href="http://richsoni.com/ecliptic">Introducing Vim-Ecliptic: A More Natural Clipboard Integration</a></li>\n<li><a href="http://richsoni.com/gitwitit">Git Post</a></li>\n</ol>\n<h2>Website Redesign</h2>\n<p><a href="http://richsoni.com">richsoni.com</a> has been completely redesigned.\nI hope you enjoy the many reader experience related improvements.</p>\n<h2>RSS</h2>\n<p>The site now supports RSS! <a href="http://richsoni.com/feed">richsoni.com/feed</a>.</p>\n<h2>Look Forward To Sharing With You</h2>\n<p>There are great things coming soon, and I am super excited to share them with you.\nThere are several articles based on longer term experiments coming to fruition soon.\nMake sure to check them out.</p>\n<p>Talk to you soon.\n~ Rich</p>',frontmatter:{title:"Updates!!!",hero:"/images/posts/construction.jpg"},fields:{date:"2014-11-02"}}},pathContext:{url:"/posts/2014-11-02-updates/"}}}});
